    return(
        <section className="feeds-page">
            <NavBar/>
            <div className="profileTop">
                <div className="profileCover">        
                    <img className="profileCoverImg" src="./Images/bird.png" alt=""/>
                    <img className="profileUserImg" src="./Images/bird.png" alt=""/>
                </div>   
                <div className="profileInfo">        
                    <h4 className="profileInfoName"> Racha nad</h4>
                    <span className="profileBio">Hello ! :/ </span>
                </div>            
            </div>
            <div className="profileBottom">
                <div className="feeds-content">
                    <NewPost />
                    <div className="posts">
                        <Post/> 
                        <Post/> 
                        <Post/> 
                        <Post/> 
                    </div>
                    <ListFollow  nom="Vos Amis"/>
                </div> 
            </div>
        </section>
    );
}

export default Profil ;

